import React from 'react';
import { Image, Grid, Header, Icon, Container, Divider, Card } from 'semantic-ui-react';
import cover from '../static/cover.png';
import '../App.css';


class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      container: ''
    };
  };

  render() {
    return(
        <div>
	        <Grid.Row>
	        <Image src = {cover} size = 'medium' centered/>
	        <Divider hidden/>
	        </Grid.Row>
	        <Grid.Row>
	          <Container text textAlign = 'center'>
		          <p className = 'textblock' style={{'fontFamily': 'cursive', 'fontSize': '150%'}}>
		            The Nepalese Students Association is a social 
		            and cultural organization that was established 
		            to unite patriots who are of Nepali origin or 
		            have interest in Nepalese culture. 
		            The main purpose of NSA is to promote 
		            and raise awareness about Nepalese language, 
		            literature, cultural and arts through various 
		            activities.
		          </p>
	          </Container>
	        </Grid.Row>
	        <Divider hidden/>
	        <Grid.Row>
	        <div>
	          <Header as='h2' icon textAlign='center' color = '#56C6AC'>
	            <Icon circular color= 'teal' name='american sign language interpreting' />
	            <Header.Content style = {{'color': '#040a74'}}>NAMASTE!!</Header.Content>
	          </Header>
	        </div>
	        </Grid.Row>
      </div>
  )};
};

export default Home;
